wikibase-anonymouseditwarning:
A warning message displayed using the MediaWiki notification system each time the user starts to edit something on an entity (see [[d:Wikidata:Glossary]]) page (e.g. by clicking an edit button).

Basically, the message shall make the user aware that his/her IP will be recorded when saving as long as not being logged and encourage him/her to use a registered account.

The link on "IP address" should correspond to the Wikipedia article in the language of the message, if that article exists.

Parameters:
* $1 - (Optional) any one of the following messages:
** {{msg-mw|Wikibase-entity-item}}
** {{msg-mw|Wikibase-entity-property}}
See also:
* {{msg-mw|Anoneditwarning}}
* {{msg-mw|Sf autoedit anoneditwarning}}

{{Doc-jqueryMsg}}

